export default function ToggleFavorites({ toggle }) {
    return (
        <span className="toggle-favorites" onClick={this.toggleFavoritesButton}>
        <button onClick={this.props.toggle}>
            {
                this.state.favorites 
                ? "Bodacious Tunes"
                : "Gag Me With A Spoon"
            }
        </button>
</span>
    )
}
